<!DOCTYPE html>
<html>

{% include head.html  %}

<body id="myPage" onload="init()">

<!-- Header -->
<div>
header.
</div>

<!-- Content -->
<div id="github_page_default_content" class="w3-container" style="display:none;">
{{ content }}
</div>

<!-- Loader -->
<div id="github_page_default_loader" style="display: block; padding:20px;">
    <div id="loader" style="margin-left: auto; margin-right: auto;">
    
        {{ append: site.github.build_revision | relative_url }}
    
    </div>
</div>
    
    
    

<!-- Footer -->
<div>
footer.
</div>


</body>
</html>
